import { Dialog } from '@mui/material'
import React from 'react'


const LoginDialog = ({openDialog , setOpen}) => {
  console.log(openDialog,  "sajds", setOpen)
  const handleClose =() =>{
   setOpen(false)
  }
  return (
   <>
    <Dialog open={openDialog} close={handleClose}>
    hello
    </Dialog>
   </>
  )
}

export default LoginDialog
